// BlunderbussLexerInit initializes any static state used to implement BlunderbussLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewBlunderbussLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func BlunderbussLexerInit() {
	staticData := &BlunderbussLexerLexerStaticData
	staticData.once.Do(blunderbusslexerLexerInit)
}

// NewBlunderbussLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewBlunderbussLexer(input antlr.CharStream) *BlunderbussLexer {
	BlunderbussLexerInit()
	l := new(BlunderbussLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &BlunderbussLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "Blunderbuss.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

